import GetAll from "../components/all_recipes";
import React, { useState } from "react";

const All = (props) => {
    const [recipeList, setRecipeList] = useState([]);

    return (
        <div>
            <GetAll
                recipeList={recipeList}
                setRecipeList={setRecipeList}
            />
        </div>
    );
};

export default All;
